INSERT INTO `Consent` VALUES (3,'Milal Church Liability Release Form','밀알교회에서 제공하는 모든 프로그램, 수업, 활동(이하 통칭하여 “프로그램”) - 예:\n다니엘한글문화학교 등—에 참여하기 위해, 저희(부모/보호자 또는 18세 이상의 참가자)는 저 자신 및/또는 저희 자녀 참가자를 대신하여, 밀알교회 및 해당 프로그램, 그리고 이에 관련된 모든 스태프(자원봉사자, 목회자, 이사, 직원, 대리인 등을 포함하되 이에 국한되지 않음)에 대해 개인 상해, 질병, 사망뿐 아니라 재산 피해 및 그와 관련된 모든 비용 등과 관련된 모든 책임, 청구, 요구사항으로부터 영구적으로 면책하며, 어떠한 법적 책임도 묻지 않기로 동의합니다. \n또한, 저희는 프로그램 및 그에 관련된 활동, 제공되는 음식물 섭취, 이동 수단, 레크리에이션 등으로 인해 발생할 수 있는 모든 위험, 상해, 질병, 사망, 손해 및 비용에 대한 책임을 전적으로 감수합니다. 더불어, 밀알교회가 참가자 또는 서명인에게 필요한 교통, 식사, 숙박 등을 제공하는 것에 동의하고 허가합니다. 서명인 또는 참가자는 프로그램과 관련된 모든 활동 중 발생할 수 있는 위험을 충분히 이해하고 있으며, 이를 전적으로 감수함에 동의합니다. 저희는 자녀가 해당 프로그램, 관련 활동, 등에 전적으로 참여할 수 있도록 허락하며, 필요 시 병원 이송 및 응급 수술을 포함한 의료 처치를 허가하고, 발생할 수 있는 의료비용에 대해 전적으로 책임질 것임을 확인합니다. 또한, 만약 의료적인 사유, 가족 비상사태, 징계 조치 등의 이유로 참가자가 조기 귀가해야 하는 경우, 그에 따른 귀가 비용 전액을 부담할 것임을 확인합니다. \n밀알교회가 프로그램 중 촬영한 비디오, 사진, 오디오 녹음 또는 기타 영상/음성 기록물을 교회가 적절하다고 판단하는 방식으로 사용 또는 공개하는 것에 동의합니다.\n이 양식이 구글 폼 또는 웹사이트 상의 작성 가능한 양식으로 사용되는 경우, 필요한 정보를 기입함으로써 저희는 위의 모든 내용에 동의함을 확인합니다.\n\n\n','In order to participate in any programs, classes and activities offered by Milal Church(collectively the “Program”)such as, but not limited to, Daniel Korean Cultural School, we/I, (Parent/Guardian or participant over 18 years old) on behalf of myself or our/my child participant do hereby release, forever discharge and agree to hold harmless Milal Church and its Program, any staffs involved with, including but not limited to, volunteers, pastors, its directors, employees and agents thereof from any and all liability, claims or demands for personal injury, sickness or death, as well as property damage and expenses, of any nature whatsoever which may be incurred by or to the undersigned or the participant while said undersigned or participant is participating in the Program and any related activities.\nFurthermore, we/I, assume all risk or personal injury, sickness, death, damage and expense as a result of the participation in any of the Program and related activities, consumption of any food and drinks provided, transportation, and recreation involved therein. Further, our/my authorization and permission are hereby given to Milal Church to furnish any necessary transportation, food and lodging for the undersigned or the participant.\nThe undersigned or the participant UNDERSTAND AND HEREBY AGREE TO ASSUME ALL OF THE RISKS WHICH MAY BE ENCOUNTERED ON ACTIVITIES ACCOMPANIED WITH THE PROGRAM, INCLUDING ACTIVITIES PRELIMINARY AND SUBSEQUENT THERETO. We/I, hereby grant our/my permission for my\nchild to participate fully in said Program, related activities, and hereby give our/my permission to take said participant to a doctor or hospital and hereby authorize medical treatment, including but not limited to, to emergency surgery or medical treatment, and confirm that we/I shall assume the responsibility of all medical bills, if any. Further, should it be necessary for the participant to return home due to medical reasons, family emergencies, disciplinary action or otherwise, we/I hereby confirm that we/I shall assume all transportation costs.\nWe/I consent to the use of any video images, photographs, audio recordings, or any other visual or audio reproduction that may be taken during the participation of the undersigned or the participants to the Program attended by the undersigned or the participant to be used or shown, as Milal Church deems appropriate.\nIf this form is used on Google or any fill-able form on the website, by filling out the requested information, we/I confirm that we/I hereby agree to the consent noted above.'),(4,'Daniel School Statement','다니엘 학교는 기독교 세계관과 가치관을 기반으로 교육을 제공합니다. 학생들에게 도덕적 가치, 성경적 원칙, 그리스도의 사랑과 관계 중심의 교육을 통해 올바른 성장과 발전을 촉진합니다. 우리는 학부모님들이 다니엘 학교의 교육 목표와 가치에 동의하며, 학생들이 이러한 기독교적 교육 환경에서 성장하고 발전할 수 있도록 협력해 주시기를 기대합니다.\n\n\n','Daniel School provides education based on Christian values. We promote the growth and development of our students through moral values, biblical principles, Christ\'s love, and relationship-centered education. We hope that parents agree with Daniel School’s educational goals and values and cooperate to help students grow and develop in this Christian educational environment.');
