INSERT INTO `Request` VALUES (2,'godlovesmaim@gmail.com','4169996868','조마임','조하엘','낯을 많이 가리니 저번 학기와 동일한 선생님과 함께 하길 원합니다.','COMPLETE','박정윤쌤반으로 넣기로 함','2026-01-19 07:14:33'),(3,'euny911209@gmail.com','6478639477','신영은','김주원','가능하면 신태웅학생과 같은반으로 넣어주시면 감사하겠습니다.','COMPLETE','신태웅 등록과 함께 같은반으로 가도록 배치 예정','2026-01-20 17:17:16'),(4,'cindyrn84@gmail.com','6475880322','Cindy Cho','이지아 / Gia Rhee','Gia is level 3 ','COMPLETE','알수 없는 요청임','2026-01-19 07:15:36'),(5,'mlkim4385@gmail.com','647.863.4385','김미리','굴라 김 케일리 (Kaylee Kim Gula)','아이가 처음에 낯을 많이 가려서 선생님의 관심이 처음에 필요할것같습니다.','COMPLETE','선생님께 전달할 것','2026-01-19 07:16:11'),(6,'lenapark6780@gmail.com','6475026780','lena park','김다누 / Danu Kim','k-wave option ','COMPLETE','집중반과 수업이 겹쳐서 k wave 들을 수 없다고 이메일 드림','2026-01-19 02:17:06'),(7,'jihoonmigon@gmail.com','6477794557','김미곤','김민성','작년 가울에 처음 한글수업을 들었어요.','COMPLETE','','2026-01-19 07:16:24'),(8,'gjgpals1024@gmail.com','6478923505','허혜민','남온유','정확한 한글 레벨을 모르겠어요.. 아이 수준이랑 안맞을 경우 가능한 수업내에서 변경부탁드립니다.','COMPLETE','2024년 한글중급이었기에 현재 레벨 12로 설정했는데, 선생님과 상의후 레벨 9로 가야할 수도 있음 ','2026-01-19 07:23:06'),(9,'gmandme78@gmail.com','778.689.4042','김보배','임한나','한글 중급 자리 있으면 웨이팅 부탁드립니다. 한글중급, 저학년 미술, 플룻 입니다.','COMPLETE','한글중급으로 이동하고 이메일했음','2026-01-20 17:15:48'),(10,'juliekang131@gmail.com','4168851290','강주혜','김성진','한국말이 어렵습니다. 초급 집중반으로 등록하고 싶습니다. ','COMPLETE','어머님 한국말 어려워서 사촌인 하겸 어머님과 연락해서 성진, 다은 수업 확정함','2026-01-20 17:16:23'),(11,'karenku9@gmail.com','6476077898','구보정','이성하','1교시 미술 2교시 한글 입문 3교시 바이올린 원합니다. 안들어가지네요. 부탁드립니다. 감사합니다. ','COMPLETE','어머님께 문자로 현재 바이올린 반 차서 이동 어렵다고 이야기함. 또한, 3교시 동화반도 성하 수준 아이들 있어서 괜찮을 거라고 말씀드림\n-> 바이올린 취소하는 학생이 있어서 바이올린 수업으로 넣었음','2026-01-19 02:17:32'),(12,'juliekang131@gmail.com','4168851290','강주혜','김다은','한국어를 거의 못합니다. 사촌이 G3에 있어요. 3교시 수업을 같이 하고 싶습니다. ','COMPLETE','김다은, 김성진 형제여서 어떤 요청인지 전화해볼 것\n\n어머님 한국말 어려워서 사촌인 하겸 어머님과 연락해서 성진, 다은 수업 확정함','2026-01-20 17:16:40'),(13,'trtyium10@gmail.com','6479398264','이윤미','박주찬','혹시 탁구반이 자리가 생기면... 탁구 1교시에 지원 희망합니다. ^^','COMPLETE','웨이트리스트에 올려둠','2026-01-19 07:31:40'),(14,'jungafilm@gmail.com','6478808055','Junga Song (송정아)','Evan Korsak','마','COMPLETE','어떤 내용인지 확인안됨','2026-01-19 04:02:56'),(15,'Bonniejyu@gmail.com','416-9927921','Bonnie Yu','Ella Yu','1교실에도 서예서화반 자리 비면 봐궈주세요.','REQUESTED','','2026-01-18 23:26:19'),(16,'jasmin1004@gmail.com','4169376693','곽재연','조승우','혹시 통기타 1교시에 가능하면, 3교시에 한국 역사 부탁드려요! ','COMPLETE','1교시 미술, 2교시 통기타, 3교시 역사로 바꿈','2026-01-19 04:03:44'),(17,'Carolpark33@gmail.com','4169128965','Carol Park','Carol Park','성인입니다. 3교시 서예서화반을 실수로 눌렀어요.  1교시 와 2교시 등록 부탁 합나다','COMPLETE','확인하고, 이메일 했음','2026-01-19 04:04:02'),(18,'lucy.park.oh@gmail.com','6475188280','Lucy Park','Abigail Oh','Can she please be in the calligraphy for period one? If possible. ','COMPLETE','9학년이여서 1교시 skip 2교시 미술 3교시 K speaking 듣기로 함 1교시 자리 생기면 넣기로 함','2026-01-19 07:35:18'),(19,'Lucy.park.oh@gmail.com','6475188280','Lucy Park','Ashley Oh','Can she please do calligraphy in period one or two?','COMPLETE','Ashley 는 원래대로 입문, 역사 K speaking 하기로 함','2026-01-19 07:35:45');
